package com.xzj.stu.java.base;

/**
 * 字符串String 有长度限制吗
 *
 * https://juejin.im/post/5d53653f5188257315539f9a
 * @author zhijunxie
 * @date 2019/8/14 13:58
 */
public class StringTest {
    public static void main(String[] args) {
        // 1、编译期限制

        //65534
        String str1 = "";
        System.out.println(str1.length());

        //65535 编译器报错：错误: 常量字符串过长
//        String str2 = "";
//        System.out.println(str2.length());


        /**
         * 看String源码，根据public String(char value[], int offset, int count)的定义,
         * count是字符串长度，int类型，最大为Integer.MAX_VALUE个,即2147483647字符。
         *
         * 那为什么String最多只能有65534个字符？
         *
         * 因为当我们使用字符串字面量直接定义String的时候，是会把字符串在【常量池】中存储一份的。那么上面的65534就是常量池的限制了。
         *
         * 常量池中每一项数据也有自己的类型。Java中的UTF-8编码的Unicode字符串在常量池中以CONSTANT_Utf8类型表示。
         * CONSTANT_Utf8_info是一个CONSTANT_Utf8类型的常量池数据项，它存储的是一个常量字符串。
         * 常量池中的所有字面量几乎都是通过CONSTANT_Utf8_info描述的。CONSTANT_Utf8_info的定义如下：
         * CONSTANT_Utf8_info {
         *     u1 tag;
         *     u2 length;
         *     u1 bytes[length];
         * }
         *
         * 我们使用字面量定义的字符串在class文件中是使用CONSTANT_Utf8_info存储的，而CONSTANT_Utf8_info中【u2 length】表明了该类型的长度。
         * u2是无符号的16位整数，因此理论上允许的的最大长度是2^16=65536。
         * 而 java class 文件是使用一种变体UTF-8格式来存放字符的，null 值使用两个 字节来表示，因此只剩下 65536 - 2 ＝ 65534个字节
         *
         * the class file format spec说明：
         * The length of field and method names, field and method descriptors, and other constant string values is limited to 65535 characters by the 16-bit unsigned length item of the CONSTANTUtf8info structure (§4.4.7).
         * Note that the limit is on the number of bytes in the encoding and not on the number of encoded characters. UTF-8 encodes some characters using two or three bytes. Thus, strings incorporating multibyte characters are further constrained.
         *
         * 因此：
         * 在Java中，所有需要保存在常量池中的数据，长度最大不能超过65535，这当然也包括字符串的定义
         *
         */


        // 2、运行期限制

        /**
         * 上面提到的这种String长度的限制是编译期的限制，也就是使用String s= "";这种字面值方式定义的时候才会有的限制
         *
         * 那么String在运行期的限制就是上面提到的Integer.MAX_VALUE，这个值约等于4G，在运行期，如果String的长度超过这个范围，就可能会抛出异常。(在jdk 1.9之前）
         * int 是一个 32 位变量类型，取正数部分来算的话，他们最长可以有：
         * 2^31-1 =2147483647 个 16-bit Unicodecharacter
         *
         * 2147483647 * 16 = 34359738352 位
         * 34359738352 / 8 = 4294967294 (Byte)
         * 4294967294 / 1024 = 4194303.998046875 (KB)
         * 4194303.998046875 / 1024 = 4095.9999980926513671875 (MB)
         * 4095.9999980926513671875 / 1024 = 3.99999999813735485076904296875 (GB)
         */

    }
}
